    false,nt"url": null,nt"notes": "Goose drive trapping and banding was successfully
    conducted in the Galena and North Slope areas of Alaska in 1978. This was the fourth
    year of a five consecutive year banding program to band white-fronted geese in their
    major production areas in Alaska. Although white-fronted geese were our prime target
    species, substantial numbers of black brant and lesser Canada geese were banded
    in addition to white-fronts. The banding crew was comprised of U.S. Fish and Wildlife
    Service migratory bird personnel from Juneau and Anchorage along with a representative
    from the Central Flyway. Methods, results, and recommendations are provided in this
    report.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
